import React, {Component} from 'react';
import {Line} from 'react-chartjs-2';

// const GetDimensions = () => {
//     const { height, width } = useWindowDimensions();
  
//     return (
//         width = {width},
//         height = {height}
//     );
//   }

class EnergyGraph extends Component{

    constructor(props) {
        super(props);
        this.state = {
            energygraphData: {

                labels: ['8 AM', '9 AM', '10 AM', '11 AM', '12 PM', '1 PM', '2 PM', '3 PM', '4 PM', '5 PM', '6 PM', 
                '7 PM', '8 PM', '9 PM', '10 PM', '11 PM', '12 AM'],

                datasets: [
                    {
                        label: 'Task Switches',
                        data: [
                            11,
                            16,
                            18,
                            16,
                            14,
                            9,
                            2,
                            3,
                            4,
                            12,
                            18,
                            22,
                            24,
                            26,
                            23,
                            22,
                            18
                        ],
                        borderWidth: 8,
                        borderColor: "rgba(20, 177, 183, 0.4)",
                        pointBackgroundColor: "rgb(77, 77, 77, 1)",
                        tension: 0.4,
                        pointRadius: 8
                    }
                ]
            }
        }
    }

    render(){

        return (
            <div className = "energy-graph">
                <Line
                    data = {this.state.energygraphData}
                    width = {1580}
                    height = {700}
                    options = {{
                        maintainAspectRatio: true,
                        responsive: true,
                    }}
                />
            </div>
        )
    }
}

export default EnergyGraph;
